import React from 'react';
import Footer from './components/Footer/Footer';
import Home from './components/Home/Home';
import './App.css';
import { Nav, Navbar, NavbarCollapse, NavbarContext, NavbarToggle } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Route, Link } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <header className="App-header f2">
        <h1>pressure sensitive</h1>
      </header>
      <div className='MainNav'>
        <Navbar bg="white" expand="lg">
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto MainMenu">
              <Nav.Link href="#home" className="pr-4">home</Nav.Link>
              <Nav.Link href="#events" className="pr-4">events</Nav.Link>
              <Nav.Link href="#listen" className="pr-4">listen</Nav.Link>
              <Nav.Link href="https://pressuresensitive.bandcamp.com/" className="pr-4">store</Nav.Link>
              <Nav.Link href="#contact">contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
      <div className="Footer">
        <Footer />
      </div>
    </div>
  );
}

export default App;
